[regex1]
regex: \d{1,2}/\d{1,2}/\d{2,4}
replace: DATE-STAMP

[regex2]
regex: \d{2}:\d{2}:\d{2}
replace: TIME-STAMP

[regex3]
regex: \d{2}:\d{2}:\d{2}.\d{6}
replace: ELAPSED-TIME-STAMP

[regex4]
regex: \d{1}:\d{2}:\d{2}.\d{6}
replace: ELAPSED-TIME-STAMP

[regex5]
regex: seconds=\d{2}, microseconds=\d{6}
replace: SECONDS-MICROSECONDS

[regex6]
regex: <h3>Iteration [0-9]* .*<\/h3>
replace: ITERATION-HEADER

